import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Chatbot from "./components/Chatbot";
import FAQ from "./components/FAQ";
import "./styles.css";

const App = () => {
  return (
    <Router>

        <Routes>
            <FAQ/>
            <Chatbot/>
         
        </Routes>
    </Router>
  );
};

export default App;
